00088         private static void CompileFinished(string arg1, CompilerMessage[] arg2)
00089         {
00090 
00091             if (!PackObjectSettings.Single.deleteBadCode)
00092                 return;
00093 
00094             // bool that indicates if we looked for codegen orphaned by user moving the folder
00095             bool cleanOrphanCodegen = false;
00096 
00098             foreach (var arg in arg2)
00099             {
00100                 // Check if this is a codegen file by its path and having Pack_ in the name.
00101                 if (arg.type == CompilerMessageType.Error && arg.file.Contains(GENERATED_SUBFOLDER) && arg.file.Contains("Pack_"))
00102                 {
00103                     // TEST - added to delete permanent loop due to users moving folders around.
00104                     File.Delete(arg.file);
00105 
00106                     // Search entire project for codegen that doesn't belong if we detected a name collision (user moved old folder most likely)
00107                     if (!cleanOrphanCodegen && arg.message.Contains("already contains"))
00108                     {
00109                         cleanOrphanCodegen = true;
00110                     }
00111 
00112                     deleteAllPending = true;
00113                 }
00114 
00115                 // If we detected orphaned code, seek and destroy.
00116                 if (cleanOrphanCodegen)
00117                 {
00118                     var possibleCodegen = Directory.GetFiles("Assets" + _, "Pack_*", SearchOption.AllDirectories);
00119                     Debug.Log("<b>Found</b> " + possibleCodegen.Length + " possible orphans");
00120                     foreach (var f in possibleCodegen)
00121                     {
00122                         Debug.Log("possible: " + f);
00123                         if (f.Contains(GENERATED_SUBFOLDER) && !f.Contains(codeGenFolderPath))
00124                         {
00125                             Debug.LogWarning("Codegen appears to have been moved. Deleting. " + f);
00126                             File.Delete(f);
00127                             //deleteAllPending = true;
00128                             rebuilding = true;
00129                             continue;
00130                         }
00131                     }
00132                 }
00133 
00134                 if (deleteAllPending)
00135                 {
00136                     // Suppressing errors in the log that we are going to clear up.
00137                     Debug.ClearDeveloperConsole();
00138                     Debug.LogWarning("Script errors found in PackObject codegen. Deleting outdated codegen. " +
00139                         "To see these file errors and manually delete, disable 'Delete Bad Code' in PackObjectSettings.");
00140                 }
00141             }
00142         }
