00339         public TypeInfo MakeRecordCurrent(Type type, ref bool haschanged)
00340         {
00341             tempProcessedTypes.Add(type);
00342 
00343             TypeInfo currTypeInfo;
00344             int index = catalogue.TryGetValue(type.FullName, out currTypeInfo);
00345 
00346             var attrs = type.GetCustomAttributes(typeof(PackObjectAttribute), false);
00347 
00349             if (attrs.Length == 0)
00350             {
00351                 return null;
