00360 #endif
00361 
00363             var packObjAttr = (attrs[0] as PackObjectAttribute);
00364 
00366             if (packObjAttr == null)
00367             {
00369                 if (currTypeInfo != null)
00370                 {
00371                     catalogue.Remove(type.FullName);
00372                     Debug.Log("Deleting record-less codegen " + type.Name);
00373                     haschanged = true;
00374                 }
00375                 return null;
00376             }
00377 
00379             if (type.IsValueType && !type.IsUnManaged())
00380             {
00381                 Debug.LogWarning(type.Name + " is a PackObject, but cannot be packed because it is a managed type. Structs cannot contain references or any managed types to be packable. ");
00382 
00384                 if (currTypeInfo != null)
00385                 {
00386                     catalogue.Remove(type.FullName);
00387                     haschanged = true;
00388                 }
00389                 return null;
00390             }
00391 
00393             if (index == -1)
00394             {
00395                 currTypeInfo = new TypeInfo(type);
00396                 haschanged = true;
00397             }
00398 
00399             GetPackableFields(type, currTypeInfo, packObjAttr);
00400 
00403             if (currTypeInfo == null)
00404             {
00405                 haschanged = true;
00406                 Debug.Log("No record yet for " + type.Name);
00407                 return GenerateAndRecord(type, currTypeInfo, packObjAttr);
00408             }
00409 
00410             currTypeInfo.filepath = GetExtFilepath(type);
00411 
00413             if (currTypeInfo.codegenFileWriteTime != File.GetLastWriteTime(currTypeInfo.filepath).Ticks)
00414             {
00415                 haschanged = true;
00416                 Debug.Log("Codegen file time out of date, regenerating. " + currTypeInfo.filepath);
00417                 return GenerateAndRecord(type, currTypeInfo, packObjAttr);
00418             }
00419 
00420             long hash = type.TypeToHash64();
00422             if (currTypeInfo.hashcode != hash)
00423             {
00424                 haschanged = true;
00425                 //Debug.Log(currTypeInfo.hashcode + " Type Compare mismatch " + hash);
00426                 currTypeInfo.hashcode = hash;
00427                 return GenerateAndRecord(type, currTypeInfo, packObjAttr);
00428             }
00429 
00430             //Debug.Log(type.Name + " has not changed " + currTypeInfo.hashcode);
00431             haschanged = false;
00432             return currTypeInfo;
00433         }
